import HourCard from "../DailyWeather/HourCard";

const FavoriteWeather = (props) => {
    console.log("In FavoriteWeather.js ovo je props ->");
    console.log(props.weather);

    return(
        <HourCard className="w-90 d-flex p-2">
            <h2 className="align-self-center">{props.weather.name}</h2>
            <img src={`http://openweathermap.org/img/w/${props.weather.icon}.png`} className="align-self-center"/>
            <h2 className="align-self-center">{Math.round(props.weather.responseObject.main.temp)} °C</h2>
            <h3 className="align-self-center">It is currently {Math.round(props.weather.responseObject.main.temp)} °C out with {props.weather.responseObject.weather[0].description}.</h3>

        </HourCard>
    );
}

export default FavoriteWeather;
